@Robber_Baron_ Videos (likely propagandistic) coming from China of people dropping in the streets. Family stocked up in late Jan. 

Distinctly recall Pelosi and others mocking the coof, saying it was all racist fearmongering, and to come party in Chinatown.

By Mar, obvious it was overblown.

@marklevinshow Have you ever considered the possibility that they have done the long term research and realized that this is the best path forward to long term profits?

Kinda like Saudi Arabia and China gearing up for green energy production?

Ever think maybe you're the one who's wrong?
